for (let midiNote = 48; midiNote < 80; midiNote += 2) {
    const latinNote = midiDict[`${midiNote}`]
    defaultNotesList.push(latinNote)
}

class AudioManager {
    constructor(audioContext) {
        this.audioCtx = audioContext;
        this.bpm = 700;
        this.tracks = [];
        this.createdAudios = [];
        this.gainNodes = []
        this.matrixes = []; // partitures for each track
        this.mutedPrevs = [];

        this.startedAt = 0;
        this.intervals = [];

        this.instruments = 0;
        this.isLoaded = false;
        this.isPaused = false;
    }

    createAudio(parentNode, idx, src, matrix) {
        let audio = document.createElement("AUDIO")
        audio.setAttribute("type", "audio/mp3")
        audio.id = `aud${idx}`
        audio.src = src
        parentNode.appendChild(audio)

        let track = this.audioCtx.createMediaElementSource(audio)
        let gain = this.audioCtx.createGain()

        track.connect(gain)
        gain.connect(this.audioCtx.destination)
        gain.gain.value = 0.1 // change this together with the value of the created input
        this.gainNodes.push(gain)
        this.createdAudios.push(audio)
    }



    addInstrumentPartiture(instrumentName, DOMel, matrix) {
        let src = ""
        this.matrixes.push(matrix)
        for (let i = 0; i < matrix.length; i++) {
            switch (instrumentName) {
                case "grand_piano":
                    src = grand_piano[defaultNotesList[i]]
                    break;
                case "xylophone":
                    src = xylophone[defaultNotesList[i]]
                    break;
                case "music_box":
                    src = music_box[defaultNotesList[i]]
                    break;
                default:
                    break;
            }
            this.createAudio(DOMel, i + 1, src, matrix) // audio.id starts from 1, not 0
        }
        this.tracks.push(this.createdAudios)
        this.createdAudios = []
        this.isLoaded = true;
    }
    reload() {
        let playPauseBtn = document.getElementById("play-pause-btn")
        let volumes = document.querySelectorAll(".volum_instrument")
        if (this.isLoaded) {
            switch (playPauseBtn.textContent) {
                // case "START":
                //     playPauseBtn.textContent = "PAUSE"
                //     volumes.forEach((volum)=>{
                //         volum.addEventListener("mouseup", changeVolume)
                //         // onRangeChange(volum, AM.changeVolume());
                //         volum.disabled = false  
                //         // how to disable this ?
                //         console.log(volum)
                //     })
                //     if(AM.isPaused){
                //         AM.resumeAll()
                //     }
                //     else{
                //         AM.playAll()
                //     }
                //     break;
                case "PAUSE":
                    playPauseBtn.textContent = "START"
                    volumes.forEach((volum) => {
                        volum.disabled = true
                    })
                    this.stopAll()
                    break;
                default:
                    break;
            }
        }
    }
    stopAll() {
        this.intervals.forEach((int) => {
            clearInterval(int)
        })
    }
    playAll() {
        switch (this.audioCtx.state) {
            case "suspended":
                this.audioCtx.resume()
                break;
        }
        this.startedAt = Date.now()
        for (let i = 0; i < this.tracks.length; i++) {
            this.play(i)
        }
    }
    play(id) {
        let listIndex = 0
        let created = this.tracks[id]
        let trackMatrix = this.matrixes[id]

        for (let i = 0; i < 16; i++) { // for all 16 audios of track
            if (this.matrixes[id][i][listIndex] !== 0) { // currentElement
                this.tracks[id][i].play()
            }
        }
        let int = setInterval(function (audios, matrix, max) {
            // console.log(audios, matrix, max)
            listIndex++
            if (listIndex === max) clearInterval(int)
            else {
                for (let i = 0; 16; i++) {
                    // console.log(matrix[i], listIndex, max) BUGGY SHIT
                    if (matrix[i][listIndex] !== 0) {
                        audios[i].play()
                    }
                }
            }
        }, 1000 - this.bpm, created, trackMatrix, trackMatrix[0].length);
        this.intervals.push(int)
    }
    resumeAll() { // interval bugs this
        // alert(`ctx state: ${this.audioCtx.state}`)
        this.audioCtx.resume()
        this.isPaused = false;
    }
    pauseAll() {
        this.audioCtx.suspend()
        this.isPaused = true;
    }
}

window.onload = function () {
    let ctx = new(window.AudioContext || window.webkitAudioContext)();
    let AM = new AudioManager(ctx)
    var dragged;
    let main = document.getElementById("main");
    let bpm = document.getElementById("rangeBpm")

    bpm.addEventListener("change", changeBpm);
    
    function changeBpm() {
        AM.bpm = this.value;
    }

    function changeVolume(event) {
        // alert(`${event.target.dataset.id}, ${event.target.value}`)
        let x = event.target.dataset.id
        for (let i = 0 + 16 * x; i < 16 + 16 * x; i++) {
            // AM.gainNodes[i].gain.value = event.target.value
            AM.gainNodes[i].gain.linearRampToValueAtTime(event.target.value, 0.1)
        }
    }

    function mute(id) {
        for (let i = 0 + 16 * id; i < 16 + 16 * id; i++) {
            AM.mutedPrevs[i] = AM.gainNodes[i].gain.value
            AM.gainNodes[i].gain.value = 0
            // AM.gainNodes[i].gain.linearRampToValueAtTime(0, 0.2) // not sure if working
        }
    }

    function unmute(id, previousValuesList) {
        for (let i = 0 + 16 * id; i < 16 + 16 * id; i++) {
            // AM.gainNodes[i].gain.value = AM.mutedPrevs[i]
            AM.gainNodes[i].gain.linearRampToValueAtTime(AM.mutedPrevs[i], 0.2)
        }
    }
    main.addEventListener("click", function (e) {
        console.log("(target may have no id): ", e.target.id)
        switch (e.target.id) {
            case "":
                if (event.target.className.indexOf("mute_volume_btn") !== -1) {
                    let volumeRange = document.querySelector(`.volum_instrument[data-id="${event.target.dataset.id}"`)
                    switch (event.target.textContent) {
                        case "Mute":
                            event.target.textContent = "Unmute"
                            volumeRange.disabled = true;
                            mute(event.target.dataset.id)
                            break;
                        case "Unmute":
                            event.target.textContent = "Mute"
                            volumeRange.disabled = false;
                            unmute(event.target.dataset.id, AM.mutedPrevs)
                            break;
                        default:
                            break;
                    }
                }
                break;
            case "play-pause-btn":
                let playPauseBtn = document.getElementById("play-pause-btn")
                let volumes = document.querySelectorAll(".volum_instrument")
                let mutes = document.querySelectorAll('.mute_volume_btn')
                // alert(`AM is loaded: ${AM.isLoaded}`)
                if (AM.isLoaded) {
                    switch (playPauseBtn.textContent) {
                        case "START":
                            playPauseBtn.textContent = "PAUSE"
                            bpm.disabled = true;
                            volumes.forEach((volum) => {
                                volum.addEventListener("mouseup", changeVolume)
                                // onRangeChange(volum, AM.changeVolume());
                                volum.disabled = false
                                // how to disable this ?
                                console.log(volum)
                            })
                            mutes.forEach((muteBtn) => {
                                muteBtn.disabled = false
                            })
                            if (AM.isPaused) {
                                AM.resumeAll()
                            } else {
                                AM.playAll()
                            }
                            break;
                        case "PAUSE":
                            playPauseBtn.textContent = "RESUME"
                            volumes.forEach((volum) => {
                                volum.disabled = true
                            })
                            AM.pauseAll()
                            break;
                        case "RESUME":
                            playPauseBtn.textContent = "PAUSE"
                            volumes.forEach((volum) => {
                                volum.disabled = false
                            })
                            if (AM.isPaused) {
                                AM.resumeAll()
                            }
                            break;
                        default:
                            break;
                    }
                } else {
                    alert("nothing to play. Consider adding some partitures via drag and drop")
                }
                break;
            default:
                break
        }
    });

    /* events fired on the draggable target */
    main.addEventListener("drag", function (event) {

    }, false);

    main.addEventListener("dragstart", function (event) {
        // store a ref. on the dragged elem
        dragged = event.target;
        // console.log("started to take the data : ", event.target.dataset.notes)
        event.dataTransfer.setData("text/plain", event.target.dataset.notes);
        // make it half transparent
        event.target.style.opacity = .5;
    }, false);

    main.addEventListener("dragend", function (event) {
        // reset the transparency
        event.target.style.opacity = "";
    }, false);

    /* events fired on the drop targets */
    main.addEventListener("dragover", function (event) {
        // prevent default to allow drop
        event.preventDefault();
    }, false);

    main.addEventListener("dragenter", function (event) {
        // highlight potential drop target when the draggable element enters it
        let clsNames = event.target.className
        if (clsNames.indexOf("dropzone") !== -1) {
            //can be dropped
            event.target.style.background = "#DADFE1";
        }

    }, false);

    main.addEventListener("dragleave", function (event) {
        // reset background of potential drop target when the draggable element leaves it
        let clsNames = event.target.className
        if (clsNames.indexOf("dropzone") !== -1) {
            event.target.style.background = "#6b6d76";
        }

    }, false);

    main.addEventListener("drop", function (event) {
        // prevent default action (open as link for some elements)
        event.preventDefault();
        // move dragged elem to the selected drop target
        let clsNames = event.target.className
        if (clsNames.indexOf("dropzone") !== -1) {
            // drag event finished on the "+" button
            if (clsNames.indexOf("addButtonHover") !== -1) {
                event.target.style.background = "#6b6d76"; // reset the color

                function createInstrumentPanel(instrumentName) {
                    let div = document.createElement("DIV")
                    div.classList.add("instrumentDiv")
                    console.log("volumes", AM.instruments)

                    // image
                    let img = document.createElement("IMG")
                    img.classList.add("poza_instrument")
                    // img.src=`../assets/${instrumentName}.png`;
                    img.src = `../assets/synth.png`;
                    img.alt = `png ${instrumentName}`;


                    // AM.instruments++; // if we want to start from 1
                    let input = document.createElement("INPUT")
                    input.classList.add("volum_instrument")
                    input.classList.add("myRange")
                    input.dataset.id = `${AM.instruments}`;
                    input.type = "range"
                    input.min = "0.1"
                    input.max = "1"
                    input.setAttribute("value", "0.2") // how to do this?
                    input.step = "0.1"
                    input.disabled = true;
                    
                    
                    
                    // mute btn
                    let btn = document.createElement("BUTTON")
                    btn.classList.add("mute_volume_btn")
                    btn.classList.add("press")
                    btn.classList.add("press-xl")
                    btn.classList.add("press-tes")
                    btn.classList.add("press-round")
                    btn.classList.add("press-raised")
                    btn.dataset.id = `${AM.instruments}`;
                    btn.disabled = true;
                    btn.textContent = "Mute"

                    AM.instruments++; // we start from 0

                    div.appendChild(img)
                    div.appendChild(input)
                    div.appendChild(btn)
                    return div
                }
                let div = createInstrumentPanel()

                dragged.draggable = false

                let dto = JSON.parse(event.dataTransfer.getData("text"));
                AM.addInstrumentPartiture(dragged.dataset.instrumentName, dragged, dto)
                let addDiv = document.getElementById('addInstrumentDiv')
                let parent = addDiv.parentNode

                parent.insertBefore(div, addDiv)
                parent.insertBefore(dragged, addDiv)

                if (AM.startedAt !== 0) AM.reload()
            }
        }

    }, false);
}